import { useState } from 'react'
import { useNavigate } from 'react-router-dom';

function Signup() {
  const navigate = useNavigate();
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [gender, setGender] = useState('');
  const [heardFrom, setHeardFrom] = useState([]);
  const [city, setCity] = useState('');
  const [state, setState] = useState('');

  async function registerUser(event) {
      event.preventDefault();

      const response = await fetch('http://localhost:5000/api/register', {
          method: 'POST',
          headers: {
              'Content-Type': 'application/json',
          },
          body: JSON.stringify({
              name,
              email,
              phone,
              gender,
              heardFrom,
              city,
              state,
          }),
      });

      const data = await response.json();

      if (data.status === 'ok') {
          navigate('/login');
      }
  }

  return (
      <div>
          <h1>Register</h1>
          <form onSubmit={registerUser}>
              <input
                value={name}
                onChange={(e) => setName(e.target.value)}
                type="text"
                placeholder="Name"
              />
              <br />
              <input
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                type="email"
                placeholder="Email"
              />
              <br />
              <input
                value={phone}
                onChange={(e) => setPhone(e.target.value)}
                type="number"
                placeholder="Phone"
              />
              <br />
              <label>
                 Gender:
                 <select value={gender} onChange={(e) => setGender(e.target.value)}>
                     <option value="">Select...</option>
                     <option value="male">Male</option>
                     <option value="female">Female</option>
                     <option value="others">Others</option>
                 </select>
              </label>
              <br />
              <label>
                 How did you hear about this?
                 <input type="checkbox" value="LinkedIn" onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> LinkedIn
                 <input type="checkbox" value="Friends" onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> Friends
                 <input type="checkbox" value="Job Portal" onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> Job Portal
                 <input type="checkbox" value="Others" onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> Others
              </label>
              <br />
              <label>
                 City:
                 <select value={city} onChange={(e) => setCity(e.target.value)}>
                     <option value="">Select...</option>
                     <option value="Mumbai">Mumbai</option>
                     <option value="Pune">Pune</option>
                     <option value="Ahmedabad">Ahmedabad</option>
                 </select>
              </label>
              <br />
              <label>
                 State:
                 <input
                    value={state}
                    onChange={(e) => setState(e.target.value)}
                    type="text"
                    placeholder="State"
                 />
              </label>
              <br />
              <input type="submit" value="Register" />
          </form>
      </div>
  );
}

export default Signup;
